(* ::Input::Initialization:: *)
getGlassRefractiveIndex[wavelengthInMicrons_?NumericQ,glass_String]:=With[{glassName=ToLowerCase[glass]},If[glassName==="air",1,Which[KeyExistsQ[sellmeierDispersionFormulaCoefficients,glassName],With[{sellmeierCoefficients=sellmeierDispersionFormulaCoefficients[glassName]},getRefractiveIndexFromSellmeierDispersionFormula[wavelengthInMicrons,sellmeierCoefficients[[1]],sellmeierCoefficients[[2]],sellmeierCoefficients[[3]],sellmeierCoefficients[[4]],sellmeierCoefficients[[5]],sellmeierCoefficients[[6]]]],KeyExistsQ[polynomialDispersionFormulaCofficients,glassName],With[{coeffs=polynomialDispersionFormulaCofficients[glassName]},getRefractiveIndexFromPolynomialDispersionFormula[wavelengthInMicrons,coeffs[[1]],coeffs[[2]],coeffs[[3]],coeffs[[4]],coeffs[[5]],coeffs[[6]]]],KeyExistsQ[longPolynomialDispersionFormulaCoefficients,glassName],With[{coeffs=longPolynomialDispersionFormulaCoefficients[glassName]},getRefractiveIndexFromLongPolynomialDispersionFormula[wavelengthInMicrons,coeffs[[1]],coeffs[[2]],coeffs[[3]],coeffs[[4]],coeffs[[5]],coeffs[[6]],coeffs[[7]],coeffs[[8]],coeffs[[9]]]],KeyExistsQ[refractiveIndicesForSelectedWavelengths,glassName],Interpolation[refractiveIndicesForSelectedWavelengths[glassName]][wavelengthInMicrons]]]];


(* ::Input::Initialization:: *)
getRefractiveIndexFromSellmeierDispersionFormula[wavelengthInMicrons_,B1_,B2_,B3_,C1_,C2_,C3_]:=Sqrt[1+(B1 wavelengthInMicrons^2)/(wavelengthInMicrons^2-C1)+(B2 wavelengthInMicrons^2)/(wavelengthInMicrons^2-C2)+(B3 wavelengthInMicrons^2)/(wavelengthInMicrons^2-C3)]


(* ::Input::Initialization:: *)
getRefractiveIndexFromPolynomialDispersionFormula[wavelengthInMicrons_,A0_,A1_,A2_,A3_,A4_,A5_]:=\[Sqrt](A0+A1 wavelengthInMicrons^2+A2 wavelengthInMicrons^-2+A3 wavelengthInMicrons^-4+A4 wavelengthInMicrons^-6+A5 wavelengthInMicrons^-8)


(* ::Input::Initialization:: *)
getRefractiveIndexFromLongPolynomialDispersionFormula[wavelengthInMicrons_,A0_,A1_,A2_,A3_,A4_,A5_,A6_,A7_,A8_]:=\[Sqrt](A0+A1 wavelengthInMicrons^2+A2 wavelengthInMicrons^4+A3 wavelengthInMicrons^-2+A4 wavelengthInMicrons^-4+A5 wavelengthInMicrons^-6+A6 wavelengthInMicrons^-8+A7 wavelengthInMicrons^-10+A8 wavelengthInMicrons^-12)


